import React from "react";

const Warehousing = () => {

    const scrollToSection = (sectionId, offset = 0) => {
        const section = document.getElementById(sectionId);
        if (section) {
          const offsetPosition = section.offsetTop - offset;
          window.scrollTo({
            top: offsetPosition,
            behavior: 'smooth',
          });
        }
      };

    return(
        <div>Warehousing</div>
    )
}

export default Warehousing;
